  /**
   * Prueba el algoritmo de segmentación.
   * 
   * Revisa que la cantidad de células contadas en una imagen esté bien. Se define un intervalo de confianza.
   * 
   * @author Ariel Rodríguez arieli13.10@gmail.com
   */
  @Test
  public void testCellCount() { //Prueba el conteo de celulas
    try{
      String imagen = "";
      
      ImagenCodificador x = ImagenCodificadorCreador.crearImagenCodificador(AlgoritmoCodificacion.BASE64_TOMCAT);
      ImagenMatOpenCv y = (ImagenMatOpenCv) ImagenCreador.crearImagen(x.decodificarImagen(imagen), TipoImagen.OPENCV, "x", "png");
      y.toGreyScale();
      Kittler k = new Kittler();
      k.ejecutar(y);
      Segmentacion z = new Segmentacion();
      z.ejecutar(y); //Correcta cantidad es 84
      if(z.cantCelulas < 80 || z.cantCelulas>88){
        assertEquals(1, 84,0);
      }else{
        assertEquals(1,1,0);
      }
    }catch(Exception e){
      System.out.println(e.getMessage());
    }
      
  }
  
  /**
   * Prueba el algoritmo de Kittler.
   * 
   * Revisa que el umbral óptimo calculado para una imagen esté en un IC de +- 2 pixeles del correcto.
   * 
   * @author Ariel Rodríguez arieli13.10@gmail.com
   */
  @Test
  public void testKittler() { //Prueba umbral óptimo
    try{
      System.loadLibrary(Core.NATIVE_LIBRARY_NAME);
      String imagen = "";
      ImagenCodificador x = ImagenCodificadorCreador.crearImagenCodificador(AlgoritmoCodificacion.BASE64_TOMCAT);
      ImagenMatOpenCv y = (ImagenMatOpenCv) ImagenCreador.crearImagen(x.decodificarImagen(imagen), TipoImagen.OPENCV, "x", "png");
      y.toGreyScale();
      Kittler k = new Kittler();
      k.ejecutar(y);
      if(k.getUmbral() < 164 || k.getUmbral()>168){
        assertEquals(1, 166,0);
      }else{
        assertEquals(1, 1,0);
      }
    }catch(Exception e){
      System.out.println(e.getMessage());
    }
      
  }
  
